namespace Shine
{
	/** 功能-重置排行消息(generated by shine) */
	export class FuncResetRankResponse extends FuncSResponse
	{
		/** 数据类型ID */
		public static dataID:number=GameResponseType.FuncResetRank;
		
		constructor()
		{
			super();
			this._dataID=GameResponseType.FuncResetRank;
		}
		
		/** 获取数据类名 */
		public getDataClassName():string
		{
			return "FuncResetRankResponse";
		}
		
		/** 执行 */
		protected execute():void
		{
			this.me.func.getRankTool(this.funcID).onResetRank();
		}
		
	}
}
